(1,	'Корпоративная культура',	'<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<h2>Защита интересов Компании</h2>\r\n<p><img src=\"../../../storage/img/1.jpg\" alt=\"\" /></p>\r\n<ul>\r\n<li>При принятии решений по любым вопросам деятельности сотрудники обязаны руководствоваться исключительно интересами Компании и Оргполитикой.</li>\r\n<li>Сотрудники используют имущество Компании только для развития ее бизнеса.</li>\r\n<li>Сотрудники Компании воздерживаются от участия в какой-либо деятельности, если эта деятельность :</li>\r\n</ul>\r\n<ol>\r\n<li>Не согласуется с деятельностью Компании;</li>\r\n<li>Противоречит ее интересам.&nbsp;</li>\r\n</ol>\r\n<ul>\r\n<li>Не допустимы ситуации, когда при выполнении задач у сотрудника возникает личная заинтересованность, идущая вразрез с корпоративными ценностями и принципами. &nbsp;</li>\r\n<li>В ситуациях неопределенности необходимо принимать решение, которое однозначно защищает сферу интересов Компании.</li>\r\n</ul>\r\n<h2>Защита информации</h2>\r\n<p><img src=\"../../../storage/img/2.jpg\" alt=\"\" /></p>\r\n<ul>\r\n<li>Поступая на работу, сотрудники принимают на себя обязательства не разглашать информацию, являющуюся коммерческой тайной компании. &nbsp;</li>\r\n<li>Ни при каких условиях сотрудники не используют в своих целях или в целях третьих лиц закрытую информацию, полученную во время работы в Компании.</li>\r\n<li>Часть информации может не являться коммерческой тайной, но представлять интерес для конкурентов или других компаний. Такая информация является собственностью Компании и также не должна разглашаться.</li>\r\n<li><span style=\"color: #ff0000;\">Недопустима любая передача сторонним лицам или организациям информации, наносящей ущерб имиджу и репутации Компании. Любая негативная информация о Компании и ее сотрудниках, распространяемая или переданная работником третьим лицам, а также информация, которая может быть однозначно интерпретирована как порочащая репутацию Компании, рассматривается как нарушение условий трудового договора.</span></li>\r\n</ul>\r\n<h2>Положение об основных нормах и правилах поведения в компании АВС Фарбен</h2>\r\n<p><img src=\"../../../storage/img/3.jpg\" alt=\"\" /></p>\r\n<p><span style=\"color: #ff0000;\"><strong>Мы все</strong></span> &ndash; единая команда, работающая на достижение общей цели. Поэтому во взаимоотношениях внутри коллектива работникам и руководителям следует придерживаться этичных принципов сотрудничества.</p>\r\n<ul>\r\n<li>Мы стремимся оперативно и качественно делать свою работу.</li>\r\n<li>Мы используем свои знания, опыт и способности на благо Компании.</li>\r\n<li>Мы разделяем ответственность за результаты собственного труда.</li>\r\n<li>Мы открыто обсуждаем любые проблемы, но не говорим о проблеме без предложенного решения.</li>\r\n<li>Мы стремимся к профессиональному росту, для чего повышаем свой уровень компетентности.</li>\r\n<li>Мы стремимся думать и действовать нестандартно.</li>\r\n<li>Мы поддерживаем репутацию и престиж Компании как в рабочее, так и в нерабочее время.</li>\r\n<li>Мы всегда точны в исполнении обязательств и договоренностей, честны и открыты по отношению к коллегам и руководству при любых обстоятельствах.</li>\r\n<li>Имея собственную точку зрения в профессиональных вопросах, мы защищаем ее в открытой и аргументированной форме.</li>\r\n</ul>\r\n<p><span style=\"color: #ff0000;\">Личные отношения с коллегами не должны препятствовать выполнению поставленных задач. В Компании приветствуется инициатива, при этом учитываются границы полномочий поста и принципы субординации.</span></p>\r\n<h2>Правила поведения на рабочем месте</h2>\r\n<p><img src=\"../../../storage/img/4.jpg\" alt=\"\" /></p>\r\n<ul>\r\n<li>Рабочее время должно быть полностью отдано работе. &nbsp;</li>\r\n<li>В течение рабочего дня необходимо находиться на рабочем месте; при отсутствии - оставлять информацию о своем местонахождении менеджеру по персоналу или офис-менеджеру Компании, предварительно получив разрешение руководителя подразделения или директора компании.</li>\r\n<li>Курение, разрешено согласно графика и только в специально отведенных местах. Администрация компании за здоровый образ жизни и против курения!&nbsp;</li>\r\n<li>Мы считаем, что ответственность и высокая организованность, начинается с дисциплины. Поэтому мы четко соблюдаем трудовой распорядок, никогда не опаздываем, уважаем свое рабочее время и рабочее время своих коллег. &nbsp;</li>\r\n<li>Мы соблюдаем чистоту на своем рабочем месте.</li>\r\n</ul>\r\n<h2>Начало рабочего дня</h2>\r\n<p><img src=\"../../../storage/img/5.jpg\" alt=\"\" /></p>\r\n<ul>\r\n<li>Встаньте утром и улыбнитесь самому себе!</li>\r\n<li>Все негативное оставьте за дверью офиса и вашего рабочего места!</li>\r\n<li>Обменивайтесь хорошими новостями с коллегами в начале рабочего дня.</li>\r\n</ul>\r\n<p><strong>Формы приветствия в офисе: </strong></p>\r\n<ul>\r\n<li>Доброе утро!</li>\r\n<li>Здравствуйте!</li>\r\n<li>Приветствую Вас!</li>\r\n<li>Добрый день (вечер)!</li>\r\n<li>Доброе время суток! Удачного дня!</li>\r\n<li>Желаю всем удачного дня!</li>\r\n</ul>\r\n<p><strong>Рабочий день в офисе </strong></p>\r\n<ul>\r\n<li>Пятиминутка по отделениям (оперативное совещание в начале рабочего дня).</li>\r\n<li>Не используйте рабочее время для телефонных разговоров личного характера.</li>\r\n<li>Регламентированное время обеда и кофе-пауз.</li>\r\n</ul>\r\n<h2>Форма одежды (дресс-код)</h2>\r\n<p><img src=\"../../../storage/img/6.jpg\" alt=\"\" /></p>\r\n<p><span style=\"color: #ff0000;\">В компании принят свободный Casual стиль одежды*. Он не предполагает строгих ограничений к выбору стиля одежды, но одежда должна соответствовать следующим принципам: </span></p>\r\n<ul>\r\n<li>Опрятность</li>\r\n<li>Целесообразность</li>\r\n<li>Сдержанность в стиле одежды</li>\r\n<li>При первой встрече с третьими лицами, обязателен деловой стиль</li>\r\n<li>При последующих визитах допустим стиль, соответствующий стилю клиента, партнера и т д</li>\r\n<li>Корпоративная символика в одежде приветствуется</li>\r\n<li>Свободная одежда в неформальных ситуациях</li>\r\n</ul>\r\n<p><em>За исключением тех работ, где форменная и спец.одежда введена как необходимое условие обеспечения технологического процесса и безопасных условий труда.</em></p>\r\n<h2>Основные правила общения по телефону</h2>\r\n<p><img src=\"../../../storage/img/7.jpg\" alt=\"\" width=\"1076\" height=\"150\" /></p>\r\n<ul>\r\n<li>Отвечать на телефонный звонок доброжелательно</li>\r\n<li>Служебный телефон использовать для служебных целей</li>\r\n<li>Переговоры личного характера НЕ разрешается производить в рабочее время</li>\r\n<li>Личные переговоры должны быть строго ограничены по времени</li>\r\n<li>Строго запрещены междугородние и международные переговоры личного характера за счет Компании</li>\r\n</ul>\r\n<p>Корпоративный стандарт общения по телефону <span style=\"text-decoration: underline;\">на &laquo;внешние&raquo; звонки</span>:</p>\r\n<ul>\r\n<li>Приветствие абонента</li>\r\n<li>Название Компании</li>\r\n<li>Имя сотрудника</li>\r\n<li>Название отдела или должность (если &laquo;внешний&raquo; звонок поступает не к офис-менеджеру, а напрямую к абоненту (действительно для абонентов, у кого есть прямой номер или звонящий из вне организации может выбрать абонента напрямую кодом, минуя секретаря/ офис-менеджера)</li>\r\n</ul>\r\n<p>Например: &laquo;Здравствуйте, Компания АВС Фарбен, Кристина, Офис-менеджер&raquo;</p>\r\n<p>При переводе &laquo;внешних&raquo; звонков <span style=\"text-decoration: underline;\">внутри офисной АТС</span> предоставляйте полную информацию о звонящем; уточняйте, будет ли абонент принимать звонок. При согласии абонента, соединяйте со звонящим. При отказе абонента, узнайте причину отказа, время, когда можно будет перезвонить абоненту, извинитесь перед звонящим.</p>\r\n<p><span style=\"color: #ff0000;\">Мы НЕ передаем номера мобильного и домашнего телефонов сотрудников без их согласия</span></p>\r\n<h2>Правила общения с клиентами</h2>\r\n<p><img src=\"../../../storage/img/88.jpg\" alt=\"\" /></p>\r\n<p><span style=\"color: #ff0000;\">В основе взаимоотношений с нашими клиентами лежит доброжелательность, взаимное уважение и индивидуальный подход, клиент уникален и может стать нашим другом. </span></p>\r\n<ul>\r\n<li>Вежливо обращайтесь к клиенту так, как он себя представил (по имени или по имени-отчеству)</li>\r\n<li>Умейте слушать и слышать клиента!</li>\r\n<li>Будьте четкими и последовательными в формулировании вопросов и ответов</li>\r\n<li>Никогда не делайте клиента неправым, учитывая интересы компании.</li>\r\n<li>Демонстрируйте во всех своих действиях порядочность и честность по отношению к клиентам.</li>\r\n<li>Исполняйте обязательства перед покупателями - это основа успеха компании!</li>\r\n<li>В компании принято поздравлять Клиентов с общепринятыми праздниками (Новый год, День Рождения, 23 февраля, 8 марта и т.д.)</li>\r\n</ul>\r\n</body>\r\n</html>',	'2018-07-03 09:58:43',	'2018-08-20 10:09:52'),
(2,	'Организующая схема',	'<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<h2>Представлена в программе ASMX</h2>\r\n<p><img src=\"../../../storage/img/9.jpg\" alt=\"\" /></p>\r\n<p>Это иерархическая структура компании с подразделениями и должностями. Это распределение обязанностей и полномочий внутри предприятия.&nbsp;</p>\r\n<p>Оргсхема показывает, где и кто &laquo;стоит&raquo; в карьерной лестнице и кто за что отвечает. Когда человек наглядно видит, в какой позиции стоит он в компании, тогда он чётко понимает, какие функции он должен выполнять и как это успешнее сделать.</p>\r\n<p>Организующая схема предприятия помогает систематизировать работу, распределять её, а главное &ndash; повысить качество работы. Она является основой для нескольких важных режимов работы программы ASMX &ndash; информационный, коммуникационный центры, организующая схема функционала.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../storage/img/org.jpg\" alt=\"\" /></p>\r\n<p>Оргсхема состоит их двух типов элементов: должности и подразделений. Должности всегда находятся внутри каких-либо подразделений. Подразделения могут делиться на секции и сектора. По каждой должности в программе ASMX можно просмотреть основной функционал, ценный конечный продукт, а также контактные данные лица (телефон, e-mail), занимающего ту или иную должность.</p>\r\n<p><img src=\"../../../storage/img/org1.jpg\" alt=\"\" /> <img style=\"padding-left: 3%;\" src=\"../../../storage/img/org2.jpg\" alt=\"\" /></p>\r\n</body>\r\n</html>',	'2018-07-03 09:58:56',	'2018-08-23 09:23:41'),
(3,	'Оргполитики',	'<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p><img src=\"storage/img/10.jpg\" alt=\"\" /></p>\r\n<p>Компания ABC Farben стремится обучать своих сотрудников, сделать из каждого вновь прибывшего - уверенного и действенного сотрудника.&nbsp;</p>\r\n<p>Для этого существуют оргполитики, нормативные документы и направляющие формы. Они помогают донести основные ценности, нормы поведения, алгоритм и принятые стандарты Компании для правильного и быстрого принятия решений сотрудниками.&nbsp;</p>\r\n<p><strong>Оргполитики</strong> - это установленные общие внутренние правила и принципы поведения в Компании, обязательные для исполнения всеми сотрудниками нашей Компании, с помощью которых группа достигает согласия относительно действий и в соответствии с которыми ведёт свои дела, направленные на расширение и развитие Компании.&nbsp;</p>\r\n<p><strong>Главная оргполитика описывает:</strong></p>\r\n<ul>\r\n<li>цели Компании;</li>\r\n<li>замысел;</li>\r\n<li>ценности Компании;</li>\r\n<li>защиты интересов, информации Компании;</li>\r\n<li>основные нормы и правила поведения;</li>\r\n<li>правила поведения на рабочем месте;</li>\r\n<li>формы приветствия;</li>\r\n<li>отношения с коллегами;</li>\r\n<li>дресс-код;</li>\r\n<li>правила общения по телефону;</li>\r\n<li>правила общения с клиентами.</li>\r\n</ul>\r\n<p><span style=\"color: #ff0000;\">Главная оргполитика обязательна для изучения и исполнения всеми сотрудниками компании.&nbsp;</span></p>\r\n<p><img src=\"storage/img/11.jpg\" alt=\"\" /></p>\r\n<p><strong>Нормативный документ</strong> - это утвержденный собственниками документ, содержащий обязательные нормы, стандарты, рекомендации, установившиеся практики, классификаторы касающиеся различных видов деятельности или их результатов, для неукоснительного соблюдения сотрудниками компании, ведущие к увеличению производительности труда и поднятию престижа Компании.</p>\r\n<p><img src=\"storage/img/12.jpg\" alt=\"\" /></p>\r\n<p>Направляющая форма - это пошаговый алгоритм действий с определением понятий и характеристик, процессов выполнения работ или оказания услуг, основанный на многолетнем опыте для каждой категории сотрудников, принятый именно в нашей Компании и направленный на улучшения качества работы каждого сотрудника, достижения оптимальной пользы для Компании.</p>\r\n<h2>Где найти и изучить оргполитики, направляющие формы, нормативные документы</h2>\r\n<h3 style=\"text-align: center;\">АСМ ---&gt; Шляпы</h3>\r\n<p>Все действующие сотрудники Компании в обязательном порядке должны вовремя изучать, знать и применять в своей повседневной работе установленные Оргполитики, Направляющие формы и Нормативные документы.</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"storage/img/orgpol.jpg\" alt=\"\" /></p>\r\n</body>\r\n</html>',	'2018-07-03 09:59:15',	'2018-08-23 10:54:56'),
(4,	'Продукт должности торгового представителя',	'<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p><img src=\"../../../storage/img/13.jpg\" alt=\"\" /></p>\r\n<ol>\r\n<li><strong>Выполнен план продаж</strong></li>\r\n<li><strong>Деньги за товар находятся на счетах компании</strong></li>\r\n<li><strong>Выполнен план по новым клиентам</strong></li>\r\n</ol>\r\n<h2>1. Выполнен план продаж</h2>\r\n<p><strong>За счет:</strong></p>\r\n<ul>\r\n<li>Расширения ассортимента в торговых точках</li>\r\n<li>Увеличения доли высококачественных продуктов</li>\r\n<li>Соблюдения стандартов выкладки</li>\r\n<li>Исполнения маркетинговых мероприятий</li>\r\n<li>Соблюдения стандартов работы</li>\r\n<li>Совершенствования навыков продаж и знания продукции</li>\r\n</ul>\r\n<h2>2. Деньги за товар находятся на счетах компании</h2>\r\n<p><strong>За счет:</strong></p>\r\n<ul>\r\n<li>Контроля соблюдения финансовой дисциплины клиентами</li>\r\n<li>Ежедневного анализа дебиторской задолженности</li>\r\n<li>Комплекса мер предотвращающих появление&nbsp; &nbsp; Просроченной Дебиторской Задолженности</li>\r\n<li>Комплекса мер направленных на взыскание Просроченной Дебиторской Задолженности</li>\r\n</ul>\r\n<h2>3. Выполнен план по отгрузке новых клиентов</h2>\r\n<p><strong>За счет:</strong></p>\r\n<ul>\r\n<li>Постоянного сенсуса территории и поиска новых клиентов</li>\r\n<li>Проведения презентаций для новых клиентов</li>\r\n<li>Проведения переговоров с новыми клиентами</li>\r\n<li>Заключения договоров поставки с новыми клиентами</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n</body>\r\n</html>',	'2018-07-03 09:59:25',	'2018-08-23 10:01:22'),
(5,	'Пятый модуль',	'<p>Текст</p>',	'2018-07-03 09:59:35',	'2018-07-03 09:59:35'),
(12,	'Olecolor',	'Первая торговой марка компании в ассортимент которой вошли водно-дисперсионные краски, алкидные эмали, шпатлёвки, олифа, лаки, клей. Продукция Olecolor предназначена для сегмента домохозяйств, самостоятельно осуществляющих ремонт дома или дачи.',	'2018-09-12 08:34:31',	'2018-09-12 08:34:31'),
