(9,	'Грунтовка',	'<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Грунтовка &ndash; это качественная основа любых отделочных работ. А грунтование &ndash; основной этап подготовки поверхности к последующему нанесению финишного покрытия.</p>\r\n<p>Грунтовки повышают&nbsp;<a href=\"../../../programs/1/wiki\">адгезию (сцепление)</a>&nbsp;последующих материалов с основанием, снижают расход, повышают качество и увеличивают срок службы финишных составов, выравнивают впитывающую способность основания и обеспыливают поверхность.</p>\r\n<p>Грунтовка, в зависимости от типа и назначения, проникает в поверхность, укрепляет ее, способствует равномерному нанесению таких материалов, как краски, штукатурки, обойный и плиточный клеи, шпатлевки, уменьшает расход краски, предотвращает появление плесени и грибка.</p>\r\n</body>\r\n</html>',	'',	NULL,	12,	NULL,	0,	'2018-09-12 08:35:57',	'2018-09-12 09:32:41'),
(10,	'Грунтовкаа',	'Грунтовка',	'',	NULL,	12,	NULL,	0,	'2018-09-12 09:31:21',	'2018-09-12 09:31:21'),
(11,	'Простое задание',	'Lorem Ipsum - это текст-\"рыба\", часто используемый в печати и вэб-дизайне. Lorem Ipsum является стандартной \"рыбой\" для текстов на латинице с начала XVI века. В то время некий безымянный печатник создал большую коллекцию размеров и форм шрифтов, используя Lorem Ipsum для распечатки образцов. Lorem Ipsum не только успешно пережил без заметных изменений пять веков, но и перешагнул в электронный дизайн. Его популяризации в новое время послужили публикация листов Letraset с образцами Lorem Ipsum в 60-х годах и, в более недавнее время, программы электронной вёрстки типа Aldus PageMaker, в шаблонах которых используется Lorem Ipsum.',	'default',	NULL,	14,	NULL,	0,	'2018-09-21 16:23:07',	'2018-10-25 01:33:27'),
(12,	'Задание с тестом для закрепления материала',	'<!DOCTYPE html>\r\n<html>\r\n<head>\r\n</head>\r\n<body>\r\n<p>Lorem Ipsum - это текст-\"рыба\", часто используемый в печати и вэб-дизайне. Lorem Ipsum является стандартной \"рыбой\" для текстов на латинице с начала XVI века. В то время некий безымянный печатник создал большую коллекцию размеров и форм шрифтов, используя Lorem Ipsum для распечатки образцов. Lorem Ipsum не только успешно пережил без заметных изменений пять веков, но и перешагнул в электронный дизайн. Его популяризации в новое время послужили публикация листов Letraset с образцами Lorem Ipsum в 60-х годах и, в более недавнее время, программы электронной вёрстки типа Aldus PageMaker, в шаблонах которых используется Lorem Ipsum.</p>\r\n</body>\r\n</html>',	'test',	'[\"files\\/gradient.jpg\"]',	14,	34,	0,	'2018-10-25 01:17:09',	'2018-10-29 13:53:25'),
